 import './App.css';
import {useEffect, useState} from "react"
import axios from 'axios';
import {Chart} from "react-google-charts"

export const data = [
  [
    "Element",
    "Density",
    { role: "style" },
    {
      sourceColumn: 0,
      role: "annotation",
      type: "string",
      calc: "stringify",
    },
  ],
  ["Copper", 8.94, "#b87333", null],
  ["Silver", 10.49, "silver", null],
  ["Gold", 19.3, "gold", null],
  ["Platinum", 21.45, "color: #e5e4e2", null],
];

export const options = {
  title: "Chamados em Aberto",
  width: 600,
  height: 400,
  bar: { groupWidth: "95%" },
  legend: { position: "none" },
};

const App = () => {
  const [dados, setDados] = useState({});

  useEffect(() => {
		const delayDebounceFn = setTimeout(() => {
			const fetchData = async () => {
				try {
            const data = await axios('https://apichamados.globallive.com.br/chamados');
            setDados(data)
				} catch (error) {
					console.log(error);
				}
			};
			fetchData();
		}, 500);
	}, []);



  return (
    <div className="App">
      <h1>Gráficos em React</h1>
    </div>
  );
}

export default App;
